import logo from './logo.svg';
import './App.css';
import TodoInput from './components/TodoInput';
import { useState } from 'react';
import Todotask from './components/Todotask';

function App() {
  const[list,setList]=useState([]);
  let addlist=(input)=>{
    setList([...list,input]);
  }
  return (
    <div>
      <TodoInput addlist={addlist}/>

      <Todotask list={list}/>
    </div>
  );
}

export default App;
